using DinkToPdf;
using DinkToPdf.Contracts;
using System.Text;
using Teram.HR.Module.Recruitment.Logic;
using Teram.HR.Module.Recruitment.Logic.Interfaces;
using Teram.Module.AttachmentsManagement.Logic;
using Teram.Module.AttachmentsManagement.Logic.Interfaces;
using Xceed.Words.NET;


namespace Teram.HR.Module.Recruitment.Services
{
    public class PdfConverterService
    {
        private readonly IConverter _pdfConverter;
        private readonly IWebHostEnvironment environment;
        private readonly IAttachmentLogic attachmentLogic;
        private readonly IJobApplicantFileLogic jobApplicantFileLogic;

        public PdfConverterService(IConverter pdfConverter, IWebHostEnvironment environment, IAttachmentLogic attachmentLogic, IJobApplicantFileLogic jobApplicantFileLogic)
        {
            _pdfConverter = pdfConverter??throw new ArgumentNullException(nameof(pdfConverter));
            this.environment=environment??throw new ArgumentNullException(nameof(environment));
            this.attachmentLogic=attachmentLogic??throw new ArgumentNullException(nameof(attachmentLogic));
            this.jobApplicantFileLogic=jobApplicantFileLogic??throw new ArgumentNullException(nameof(jobApplicantFileLogic));
        }

        public byte[] ConvertWordToPdf(string wordFilePath, bool hasImage, int jobApplicantId, bool hasSign)
        {
            string base64Image = string.Empty;

            if (hasImage)
            {

                var personnalImageInfo = jobApplicantFileLogic.GetPersonalImage(jobApplicantId);

                var imageData = attachmentLogic.GetFileById(personnalImageInfo.ResultEntity.AttachmentId);

                var filaData = imageData.ResultEntity.FileData;

                base64Image = Convert.ToBase64String(filaData, 0, filaData.Length);
            }

            var backgroundPath = environment.WebRootPath+"\\Images\\back.jpg";
            backgroundPath = backgroundPath.Replace(@"\", "/");

            var htmlContent = ConvertWordToHtml(wordFilePath, base64Image, hasImage, hasSign);


            var backgroundStyle = $"background-image: url('{backgroundPath}'); background-size: cover;";

            var htmlContentWithBackground = htmlContent.Replace("<body>", $"<body style='{backgroundStyle}'>");

            var globalSettings = new GlobalSettings
            {
                ColorMode = ColorMode.Color,
                Orientation = Orientation.Portrait,
                PaperSize = PaperKind.A5,

            };

            var objectSettings = new ObjectSettings
            {
                PagesCount = true,
                HtmlContent = htmlContentWithBackground,
            };

            var pdf = new HtmlToPdfDocument()
            {
                GlobalSettings = globalSettings,
                Objects = { objectSettings }
            };

            return _pdfConverter.Convert(pdf);
        }

        static string ConvertWordToHtml(string wordFilePath, string base64Image, bool hasImage, bool hasSign)
        {
            using (var docX = DocX.Load(wordFilePath))
            {

                var backgroundFile = string.Empty;

                if (hasSign)
                {
                    backgroundFile=$"";
                }
                else
                {
                    backgroundFile="";
                }

                StringBuilder htmlBuilder = new StringBuilder();
                htmlBuilder.AppendLine("<!DOCTYPE html>");
                htmlBuilder.AppendLine("<html>");
                htmlBuilder.AppendLine("<head>");
                htmlBuilder.AppendLine("<meta charset=\"utf-8\" />");

                var styles = string.Format(@"<style type='text/css'>        
                 .a5-div {{
                     width: 160mm;
                     height: 230mm;                                   
                     background-image: url('data:image/jpeg;base64,{0}');
                     background-size: cover;
                 }}
                 .row::after {{
                     content: '';
                     display: table;
                     clear: both;
                 }}
                 .content {{
                     padding-top: 120px;                   
                 }}
                 p {{
                     line-height: 1.2;
                     text-align: right;
                     direction: rtl;
                 }}
                 span {{
                     direction: rtl;
                     font-size: 14pt;
                     text-align: right;
                     font-family: 'B Nazanin';
                     font-weight:bold;
                 }}              
             </style>", backgroundFile);
                htmlBuilder.Append(styles);
                htmlBuilder.AppendLine("</head>");
                htmlBuilder.AppendLine("<body>");
                htmlBuilder.AppendLine("<div class=\"a5-div\">");
                htmlBuilder.AppendLine("<div class=\"content\">");

                if (hasImage)
                {
                    htmlBuilder.AppendLine($"<img style='width:150px;height:150px;margin-top:-100px' src='data:image/png;base64,{base64Image}'/>");
                }

                foreach (var paragraph in docX.Paragraphs)
                {
                    if (paragraph.Text.Contains("تشکر") || paragraph.Text.Contains("پیمان پورحقانی") || paragraph.Text.Contains("منابع انسانی"))
                    {

                        htmlBuilder.AppendLine("<div class='row'>");
                        htmlBuilder.AppendLine("<div style='width:50%;float:right'></div>");
                        htmlBuilder.AppendLine("<div style='width:50%;float:left'>");
                        htmlBuilder.AppendLine($"<p style='text-align:center'>");
                        htmlBuilder.AppendFormat($"<span>{paragraph.Text}</span>");
                        htmlBuilder.AppendLine("</p>");
                        htmlBuilder.AppendLine("</div>");
                        htmlBuilder.AppendLine("</div>");
                    }
                    else
                    {
                        htmlBuilder.AppendLine($"<p>");
                        if (paragraph.Text.Contains("شرکت") || paragraph.Text.Contains("مرکز"))
                        {

                            htmlBuilder.AppendFormat($"<span style='font-size:16pt;font-weight:bold'>{paragraph.Text}</span>");
                        }
                        else
                        {
                            htmlBuilder.AppendFormat($"<span>{paragraph.Text}</span>");

                        }
                        htmlBuilder.AppendLine("</p>");
                    }
                }
                htmlBuilder.AppendLine("</div>");
                htmlBuilder.AppendLine("</div>");
                htmlBuilder.AppendLine("</body>");
                htmlBuilder.AppendLine("</html>");
                return htmlBuilder.ToString();
            }
        }
    }
}
